import React from 'react';
import {link} from 'react-router-dom'

function Navlist (props) {
  return (
    <div>
      <a class="navbar-item">
        <Link to={props.linkTo}>{props.linkName}</Link>
      </a>
    </div>
  );
}

export default Navlist;
